# biweekly contest 114

from typing import List

class Solution:
  def minOperations(self, nums: List[int]) -> int:
    occ = {}
    for n in nums:
      if n in occ:
        occ[n] += 1
      else:
        occ[n] = 1

    count = 0
    for k in occ:
      if occ[k] == 1:
        return -1

      if occ[k] % 3 == 0:
        count += occ[k] // 3

      else:
        while occ[k] % 3 != 0 and occ[k] > 1:
          occ[k] -= 2
          count += 1
        if occ[k] == 1:
          return -1
        count += occ[k] // 3

    return count

